import { Link } from "react-router-dom";
// import { useState } from "react";

export default function ProdItem() {

    
const data = [
    {
        id: 11,
        name: "Dosa",
        img: "https://pipingpotcurry.com/wp-content/uploads/2020/11/Dosa-recipe-plain-sada-dosa-Piping-Pot-Curry.jpg",
        category: "food",
        price: 270,
    },
    {
        id: 7,
        name: "Idli/Sambhar",
        img: "https://vaya.in/recipes/wp-content/uploads/2018/02/Idli-and-Sambar-1.jpg",
        category: "food",
        price: 180,
    },
    {
        id: 8,
        name: "Dal Makhni",
        img: "https://recipes.timesofindia.com/thumb/53097626.cms?width=1200&height=900",
        category: "food",
        price: 180,
    },

    {
        id: 9,
        name: "Cold Coffee",
        img: "https://www.vegrecipesofindia.com/wp-content/uploads/2021/04/cold-coffee-recipe-2.jpg",
        category: "beverages",
        price: 80,
    },
    {
        id: 10,
        name: " Tea",
        img: "https://static.toiimg.com/photo/83173328.cms",
        category: "beverages",
        price: 30,
    },

    {
        id: 2,
        name: " Coke",
        img: "https://5.imimg.com/data5/SELLER/Default/2021/12/MI/CM/OC/26602448/300-ml-coke-original-500x500.jpg",
        category: "beverages",
        price: 55,
    },
    {
        id: 3,
        name: "Lassi",
        img: "https://pipingpotcurry.com/wp-content/uploads/2021/05/Lassi-in-a-glass.jpg",
        category: "beverages",
        price: 90,
    },
    {
        id: 12,
        name: "Milk",
        img: "https://m.media-amazon.com/images/I/61lzZAgOCzL.jpg",
        category: "beverages",
        price: 40,
    },

    {
        id: 5,
        name: "Tandoori Platter",
        img: "https://images.slurrp.com/prod/recipe_images/better-butter/tandoori-paneer-platter_HX3XOHVHLY0WD9AXFZZG.webp?impolicy=slurrp-20210601&width=1200&height=675",
        category: "food",
        price: 295,
    },
    {
        id: 6,
        name: "Naan",
        img: "https://static.toiimg.com/thumb/53338316.cms?width=1200&height=900",
        category: "food",
        price: 20,
    },
    {
        id: 13,
        name: "Paneer Butter Masala",
        img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRT5kecc5mebmjSS-CrZAKaa_RUwoFa5NOuwg&usqp=CAU",
        category: "food",
        price: 240,
    },
    {
        id: 14,
        name: "Gol Gappe",
        img: "https://static.toiimg.com/photo/75107900.cms",
        category: "food",
        price: 60,
    },
];

    const foodItems = data.map((fData) => {
        return (
            
                <div className="w-75 bg-white shadow-md rounded-xl duration-500 hover:scale-105 hover:shadow-xl" productid={fData.id}>
                    <Link to="#">
                        <img className="p-4 rounded-t-lg w-72 h-80" src={require(fData.img)} alt="product" />
                    </Link>
                    <div className="px-4 py-3 w-72">
                        <Link to="#">
                            <h5 className="text-xl font-semibold tracking-tight text-gray-900 dark:text-white">fData.name</h5>
                        </Link>

                        <div className="flex items-center">
                            <div className="flex items-center justify-between">
                                <span className="text-3xl font-bold text-gray-900 dark:text-white price">&#8377;<span>fData.price</span></span>
                            </div>
                            <div className="ml-auto">
                                <Link to="#" >
                                    <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" fill="currentColor" className="bi bi-bag-plus" viewBox="0 0 16 16">
                                        <path fill-rule="evenodd" d="M8 7.5a.5.5 0 0 1 .5.5v1.5H10a.5.5 0 0 1 0 1H8.5V12a.5.5 0 0 1-1 0v-1.5H6a.5.5 0 0 1 0-1h1.5V8a.5.5 0 0 1 .5-.5z" />
                                        <path d="M8 1a2.5 2.5 0 0 1 2.5 2.5V4h-5v-.5A2.5 2.5 0 0 1 8 1zm3.5 3v-.5a3.5 3.5 0 1 0-7 0V4H1v10a2 2 0 0 0 2 2h10a2 2 0 0 0 2-2V4h-3.5zM2 5h12v9a1 1 0 0 1-1 1H3a1 1 0 0 1-1-1V5z" />
                                    </svg>
                                </Link>
                            </div>
                        </div>
                    </div>
                    <div className="m-3 text-sm font-medium">
                        <div className="text-blue-500 category">category: <span><Link to="#" >fData.category</Link></span></div>
                    </div>
                </div>
        )
    })

    return(
    <div className="w-fit mx-auto grid grid-cols-1 lg:grid-cols-3 md:grid-cols-2 justify-items-center justify-center gap-y-10 gap-x-10 my-10">{foodItems}</div>
    )
}
